ASP.NET Core 5.0 and MongoDB - data model and key data type for large amount of data<p>I don't actually try to do this, I'm just learning, but I would really like to know what would be the best solution, maybe there are some specialists here who are willing to help.</p>
<p>Let's take the most basic example: collection of posts, each post can contain collection of comments. And let's assume large amount of data.</p>
<pre class="lang-cs prettyprint-override"><code>public class Post
    {
        [BsonId]
        [BsonRepresentation(BsonType.ObjectId)]
        public Guid Id { get; set; }
        public string PostBody { get; set; }
    }
</code></pre>
<pre class="lang-cs prettyprint-override"><code>public class Comment
    {
        [BsonId]
        [BsonRepresentation(BsonType.ObjectId)]
        public Guid Id { get; set; }
        public Guid PostId { get; set; }
        public string CommentBody { get; set; }
    }
</code></pre>
<p>This model is not embedded, so it technically should be faster, because if you want to display posts only, there is no need to get comments. But if you want to get post and comments, you need to search whole comments collection.</p>
<p>And about key data type - <code>int</code> is too small, <code>long int</code> also will eventually run out. <code>Guid</code> is also finite, but should work for a little longer.</p>
<p>Is there optimal solution to this problem?</p>

