I do update once in a while my mongodb-driver package as I use for year now I layer I've made a long time ago.</p>
<p>However, today, for some personal reasons, I have refactored my tests and now have e2e full tests suite over my layer. The thing is, while doing my tests, I could reproduce a bug I had in the past, which is when I don't set an ID for my document (_id bson field)</p>
